(About time haha)...

Because of this I have been encouraged to have more interactions with you beautiful people

Some of the things that keep coming up are quite common 

- Being judgemental of self and others
- Not letting others irritate you
- Feeling bad for others 

This is totally understandable and I can definitely relate..

What if I told you that all these things are interconnected?

What if I told you that there are some very simple ways to resolve these things?

Over the course of my journey, I have stumbled upon different tools for this

And one of the most important, if not THE most important one

Is the understanding that the outer world is a reflection of our inner world..

The thoughts we think, the beliefs we hold, the emotions we feel 

They all generate a specific world view we have 

Which then generates what we experience

Often times, this isn't necessarily something we can avoid because from 0-7 years old

We are like sponges, absorbing almost everything around us

But now that we're older, we have the ability to become aware of some of these things

And when we do, we have the ability to shift them

So I encourage you to begin to look at it

What irritates you about yourself?

What are you judging yourself about? 

What is it you don't like about yourself that is reflecting on another?

It may be a bit challenging to look into this

But if we can simply ask the questions 

And then let go and take a few breaths

We will have begun the journey towards freeing ourselves from these limitations

If you are interested in guidance, I have been doing this virtually my entire life

I am well suited to diving deep, I enjoy it and can hold the space necessary

For your growth into a more peaceful state of being

PM me and let's have a conversation...

Much love,
